import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import Button from '@mui/material/Button';


function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary">
      {'Copyright © '}
      <Link color="inherit" href="https://artconnect.my.canva.site/#home">
        artconnect.com
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

export default function Contact() {
  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
      }}
    >
      <CssBaseline />
      <Container component="main" sx={{ mt: 8, mb: 2 }} maxWidth="sm">
        <Typography variant="h2" component="h1" gutterBottom>
        Contact Us
        </Typography>
        <Typography variant="h5" component="h2" gutterBottom>
          {'Address: Wits Art Museum Cnr Jorissen and, Bertha St, Johannesburg, 2001.'}
          
        </Typography>
        <Typography variant="body1"><br/>Phone: +27 11 717 1365
        <br/>
        Email : 1345397@students.wits.ac.za
          </Typography>
      </Container>
      <Box
        component="footer"
        sx={{
          py: 3,
          px: 2,
          mt: 'auto',
          backgroundColor: (theme) =>
            theme.palette.mode === 'light'
              ? theme.palette.grey[200]
              : theme.palette.grey[800],
        }}
      >
        <Container maxWidth="sm">
          <Typography variant="body1">
           Connecting South Africa's Best Creatives.
          </Typography>
          
          <Copyright />
        </Container>
      </Box>
    </Box>
  );
}
